    "Enter email addresses and/or usernames, separated by new lines or commas, for the learners you want to add. *": "\u064a\u064f\u0631\u062c\u0649 \u0625\u062f\u062e\u0627\u0644 \u0639\u0646\u0627\u0648\u064a\u0646 \u0627\u0644\u0628\u0631\u064a\u062f \u0627\u0644\u0625\u0644\u0643\u062a\u0631\u0648\u0646\u064a \u0648/\u0623\u0648 \u0623\u0633\u0645\u0627\u0621 \u0627\u0644\u0645\u0633\u062a\u062e\u062f\u0645\u064a\u0646\u060c \u0645\u0641\u0635\u0648\u0644\u0629 \u0628\u0623\u0633\u0637\u0631 \u062c\u062f\u064a\u062f\u0629 \u0623\u0648 \u0641\u0648\u0627\u0635\u0644\u060c \u0644\u0643\u0627\u0641\u0629 \u0627\u0644\u0637\u0644\u0651\u0627\u0628 \u0627\u0644\u0630\u064a\u0646 \u062a\u0648\u062f\u0651 \u0623\u0646 \u062a\u0636\u064a\u0641\u0647\u0645. *", 
