    "Sorry, no results were found.": "\u0639\u0630\u0631\u064b\u0627\u060c \u0644\u0627 \u062a\u0648\u062c\u062f \u0623\u064a \u0646\u062a\u0627\u0626\u062c.", 
    "Sorry, there was an error parsing the subtitles that you uploaded. Please check the format and try again.": "\u0639\u0630\u0631\u064b\u0627\u060c \u062d\u062f\u062b \u062e\u0637\u0623 \u0641\u064a \u0639\u0645\u0644\u064a\u0629 \u062a\u062d\u0644\u064a\u0644 \u0627\u0644\u0639\u0646\u0627\u0648\u064a\u0646 \u0627\u0644\u0641\u0631\u0639\u064a\u0629 \u0627\u0644\u062a\u064a \u062d\u0645\u0651\u0644\u062a\u0647\u0627. \u064a\u064f\u0631\u062c\u0649 \u0627\u0644\u062a\u062d\u0642\u0642 \u0645\u0646 \u0627\u0644\u0635\u064a\u063a\u0629\u060c \u062b\u0645\u0651 \u0625\u0639\u0627\u062f\u0629 \u0627\u0644\u0645\u062d\u0627\u0648\u0644\u0629. ", 
    "Sorted by": "\u0627\u0644\u062a\u0631\u062a\u064a\u0628 \u0628\u062d\u0633\u0628: ", 
    "Source": "\u0631\u0645\u0632 \u0627\u0644\u0645\u0635\u062f\u0631", 
    "Source code": "\u0631\u0645\u0632 \u0627\u0644\u0645\u0635\u062f\u0631", 
    "Special character": "\u062d\u0631\u0641 \u062e\u0627\u0635", 
    "Specify an alternative to the official course title to display on certificates. Leave blank to use the official course title.": "\u064a\u064f\u0631\u062c\u0649 \u062a\u062d\u062f\u064a\u062f \u0628\u062f\u064a\u0644 \u0644\u0644\u0639\u0646\u0648\u0627\u0646 \u0627\u0644\u0631\u0633\u0645\u064a \u0644\u0644\u0645\u0633\u0627\u0642 \u0644\u0648\u0636\u0639\u0647 \u0639\u0644\u0649 \u0627\u0644\u0634\u0647\u0627\u062f\u0627\u062a. \u0648\u064a\u064f\u0631\u062c\u0649 \u062a\u0631\u0643 \u0647\u0630\u0627 \u0627\u0644\u062d\u0642\u0644 \u0641\u0627\u0631\u063a\u064b\u0627 \u0644\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0627\u0644\u0639\u0646\u0648\u0627\u0646 \u0627\u0644\u0631\u0633\u0645\u064a \u0644\u0644\u0645\u0633\u0627\u0642.", 
    "Specify any rules or rule exceptions that the proctoring review team should enforce when reviewing the videos. For example, you could specify that calculators are allowed. These specified rules are visible to learners before the learners start the exam, along with the {linkStart}general proctored exam rules{linkEnd}.": "\u062d\u062f\u062f \u0623\u064a\u0629 \u0642\u0648\u0627\u0639\u062f \u0623\u0648 \u0627\u0633\u062a\u062b\u0646\u0627\u0621\u0627\u062a \u064a\u062c\u0628 \u0623\u0646 \u064a\u0641\u0631\u0636\u0647\u0627 \u0641\u0631\u064a\u0642 \u0645\u0631\u0627\u062c\u0639\u0629 \u0627\u0644\u0645\u0631\u0627\u0642\u0628\u0629 \u0639\u0646\u062f \u0645\u0631\u0627\u062c\u0639\u0629 \u0645\u0642\u0627\u0637\u0639 \u0627\u0644\u0641\u064a\u062f\u064a\u0648. \u0639\u0644\u0649 \u0633\u0628\u064a\u0644 \u0627\u0644\u0645\u062b\u0627\u0644\u060c \u064a\u0645\u0643\u0646\u0643 \u062a\u062d\u062f\u064a\u062f \u0623\u0646 \u0627\u0644\u0622\u0644\u0627\u062a \u0627\u0644\u062d\u0627\u0633\u0628\u0629 \u0645\u0633\u0645\u0648\u062d \u0628\u0647\u0627. \u0647\u0630\u0647 \u0627\u0644\u0642\u0648\u0627\u0639\u062f \u0633\u062a\u0643\u0648\u0646 \u0638\u0627\u0647\u0631\u0629 \u0644\u0644\u0637\u0644\u0651\u0627\u0628 \u0642\u0628\u0644 \u0623\u0646 \u064a\u0628\u062f\u0624\u0648\u0627 \u0627\u0644\u0627\u062e\u062a\u0628\u0627\u0631\u060c \u0625\u0644\u0649 \u062c\u0627\u0646\u0628 {linkStart}\u0627\u0644\u0642\u0648\u0627\u0639\u062f \u0627\u0644\u0639\u0627\u0645\u0629 \u0644\u0644\u0625\u0645\u062a\u062d\u0627\u0646 \u0627\u0644\u0645\u0631\u0627\u0642\u0628{linkEnd}.", 
    "Specify any rules or rule exceptions that the proctoring review team should enforce when reviewing the videos. For example, you could specify that calculators are allowed. These specified rules are visible to learners before the learners start the exam.": "\u062d\u062f\u062f \u0623\u064a\u0629 \u0642\u0648\u0627\u0639\u062f \u0623\u0648 \u0627\u0633\u062a\u062b\u0646\u0627\u0621\u0627\u062a \u064a\u062c\u0628 \u0623\u0646 \u064a\u0641\u0631\u0636\u0647\u0627 \u0641\u0631\u064a\u0642 \u0645\u0631\u0627\u062c\u0639\u0629 \u0627\u0644\u0645\u0631\u0627\u0642\u0628\u0629 \u0639\u0646\u062f \u0645\u0631\u0627\u062c\u0639\u0629 \u0645\u0642\u0627\u0637\u0639 \u0627\u0644\u0641\u064a\u062f\u064a\u0648. \u0639\u0644\u0649 \u0633\u0628\u064a\u0644 \u0627\u0644\u0645\u062b\u0627\u0644\u060c \u064a\u0645\u0643\u0646\u0643 \u062a\u062d\u062f\u064a\u062f \u0623\u0646 \u0627\u0644\u0622\u0644\u0627\u062a \u0627\u0644\u062d\u0627\u0633\u0628\u0629 \u0645\u0633\u0645\u0648\u062d \u0628\u0647\u0627. \u0647\u0630\u0647 \u0627\u0644\u0642\u0648\u0627\u0639\u062f \u0633\u062a\u0643\u0648\u0646 \u0638\u0627\u0647\u0631\u0629 \u0644\u0644\u0637\u0644\u0651\u0627\u0628 \u0642\u0628\u0644 \u0623\u0646 \u064a\u0628\u062f\u0624\u0648\u0627 \u0627\u0644\u0627\u062e\u062a\u0628\u0627\u0631.", 
    "Specify whether content-specific discussion topics are divided.": "\u064a\u064f\u0631\u062c\u0649 \u062a\u062d\u062f\u064a\u062f \u0645\u0627 \u0625\u0630\u0627 \u0643\u0627\u0646\u062a \u0645\u0648\u0627\u0636\u064a\u0639 \u0627\u0644\u0645\u062d\u0627\u062f\u062b\u0629 \u0627\u0644\u062e\u0627\u0635\u0629 \u0628\u0627\u0644\u0645\u062d\u062a\u0648\u0649 \u062a\u0643\u0648\u0646 \u0645\u0642\u0633\u0651\u0645\u0629.", 
    "Specify whether discussion topics are divided": "\u064a\u064f\u0631\u062c\u0649 \u062a\u062d\u062f\u064a\u062f \u0645\u0627 \u0625\u0630\u0627 \u0643\u0627\u0646\u062a \u0645\u0648\u0627\u0636\u064a\u0639 \u0627\u0644\u0645\u062d\u0627\u062f\u062b\u0629 \u062a\u0643\u0648\u0646 \u0645\u0642\u0633\u0651\u0645\u0629", 
