    "Student username/email field is required and can not be empty. Kindly fill in username/email and then press \"Add to Exception List\" button.": "\u062d\u0642\u0644 \u0627\u0633\u0645 \u0627\u0644\u0637\u0627\u0644\u0628/\u0639\u0646\u0648\u0627\u0646 \u0627\u0644\u0628\u0631\u064a\u062f \u0627\u0644\u0625\u0644\u0643\u062a\u0631\u0648\u0646\u064a \u0645\u0637\u0644\u0648\u0628 \u0648\u0644\u0627 \u064a\u0645\u0643\u0646 \u062a\u0631\u0643\u0647 \u0641\u0627\u0631\u063a\u064b\u0627. \u064a\u064f\u0631\u062c\u0649 \u0645\u0644\u0626 \u0627\u0633\u0645 \u0627\u0644\u0645\u0633\u062a\u062e\u062f\u0645/\u0627\u0644\u0628\u0631\u064a\u062f \u0627\u0644\u0625\u0644\u0643\u062a\u0631\u0648\u0646\u064a \u0648\u0645\u0646 \u062b\u0645 \u0627\u0644\u0636\u063a\u0637 \u0639\u0644\u0649 \u0632\u0631 \"\u0623\u0636\u0641 \u0625\u0644\u0649 \u0642\u0627\u0626\u0645\u0629 \u0627\u0644\u0627\u0633\u062a\u062b\u0646\u0627\u0621\"", 
    "Student username/email field is required and can not be empty. Kindly fill in username/email and then press \"Invalidate Certificate\" button.": "\u062d\u0642\u0644 \u0627\u0633\u0645 \u0627\u0644\u0645\u0633\u062a\u062e\u062f\u0645/\u0627\u0644\u0628\u0631\u064a\u062f \u0627\u0644\u0625\u0644\u0643\u062a\u0631\u0648\u0646\u064a \u0644\u0644\u0637\u0627\u0644\u0628 \u0645\u0637\u0644\u0648\u0628 \u0648\u0644\u0627 \u064a\u0645\u0643\u0646 \u062a\u0631\u0643\u0647 \u0641\u0627\u0631\u063a\u064b\u0627. \u0644\u0637\u0641\u064b\u0627\u060c \u0627\u0645\u0644\u0623 \u062d\u0642\u0644 \u0627\u0633\u0645 \u0627\u0644\u0645\u0633\u062a\u062e\u062f\u0645/\u0627\u0644\u0628\u0631\u064a\u062f \u0627\u0644\u0625\u0644\u0643\u062a\u0631\u0648\u0646\u064a \u0648\u0645\u0646 \u062b\u0645 \u0627\u0636\u063a\u0637 \u0639\u0644\u0649 \u0632\u0631 \u2019\u0623\u0644\u063a\u064a \u0627\u0644\u0634\u0647\u0627\u062f\u0629\u2018.", 
