    "Subject:": "\u0627\u0644\u0645\u0648\u0636\u0648\u0639:", 
    "Submission aborted! Sorry, your browser does not support file uploads. If you can, please use Chrome or Safari which have been verified to support file uploads.": "\u062a\u0645 \u0625\u064a\u0642\u0627\u0641 \u0639\u0645\u0644\u064a\u0629 \u0627\u0644\u062a\u0642\u062f\u064a\u0645 \u0642\u0628\u0644 \u0625\u0643\u0645\u0627\u0644\u0647\u0627! \u0639\u0641\u0648\u064b\u0627 \u0644\u0627 \u064a\u062f\u0639\u0645 \u0645\u062a\u0635\u0641\u062d\u0643 \u062a\u062d\u0645\u064a\u0644 \u0627\u0644\u0645\u0644\u0641\u0627\u062a. \u064a\u0645\u0643\u0646\u0643 \u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0645\u062a\u0635\u0641\u062d Chrome \u0623\u0648 Safari \u0648\u0627\u0644\u0644\u0630\u0627\u0646 \u062a\u0645 \u0627\u0644\u062a\u062d\u0642\u0642 \u0645\u0646 \u062f\u0639\u0645\u0647\u0645\u0627 \u0644\u0639\u0645\u0644\u064a\u0629 \u062a\u062d\u0645\u064a\u0644 \u0627\u0644\u0645\u0644\u0641\u0627\u062a.", 
