    "Successfully overrode problem score for {user}": "\u062a\u0645 \u062a\u062c\u0627\u0648\u0632 \u0646\u062a\u064a\u062c\u0629 \u0627\u0644\u0645\u0633\u0623\u0644\u0629 \u0628\u0646\u062c\u0627\u062d {user}", 
