    "Transcript Fidelity": "\u062f\u0642\u0629 \u0627\u0644\u062a\u0641\u0631\u064a\u063a \u0627\u0644\u0646\u0635\u064a", 
    "Transcript Languages": "\u0644\u063a\u0629 \u0627\u0644\u062a\u0641\u0631\u064a\u063a \u0627\u0644\u0646\u0635\u064a", 
    "Transcript Provider": "\u0645\u0632\u0648\u0651\u062f \u0627\u0644\u062a\u0641\u0631\u064a\u063a \u0627\u0644\u0646\u0635\u064a", 
