    "Undo move": "\u062a\u0631\u0627\u062c\u0639 \u0639\u0646 \u0627\u0644\u062a\u062d\u0631\u064a\u0643", 
    "Undo moving": "\u062a\u0631\u0627\u062c\u0639 \u0639\u0646 \u0627\u0644\u062a\u062d\u0631\u064a\u0643", 
