    "Use a practice proctored exam to introduce learners to the proctoring tools and processes. Results of a practice exam do not affect a learner's grade.": "\u0627\u0633\u062a\u062e\u062f\u0645 \u0627\u0645\u062a\u062d\u0627\u0646 \u062a\u062f\u0631\u064a\u0628\u064a \u0645\u0631\u0627\u0642\u0628 \u0644\u062a\u0639\u0631\u064a\u0641 \u0627\u0644\u0645\u062a\u0639\u0644\u0651\u0645\u064a\u0646 \u0628\u0625\u062c\u0631\u0627\u0621\u0627\u062a \u0648\u0623\u062f\u0648\u0627\u062a \u0627\u0644\u0645\u0631\u0627\u0642\u0628\u0629. \u0644\u0646 \u062a\u0624\u062b\u0631 \u0646\u062a\u0627\u0626\u062c \u0627\u0644\u0627\u0645\u062a\u062d\u0627\u0646 \u0627\u0644\u062a\u062f\u0631\u064a\u0628\u064a \u0639\u0644\u0649 \u0627\u0644\u062f\u0631\u062c\u0629 \u0627\u0644\u0646\u0647\u0627\u0626\u064a\u0629 \u0627\u0644\u0645\u0645\u0646\u0648\u062d\u0629 \u0644\u0644\u0645\u062a\u0639\u0644\u0651\u0645.", 
    "Use a timed exam to limit the time learners can spend on problems in this subsection. Learners must submit answers before the time expires. You can allow additional time for individual learners through the Instructor Dashboard.": "\u0627\u0633\u062a\u062e\u062f\u0645 \u0627\u0645\u062a\u062d\u0627\u0646\u064b\u0627 \u0645\u0624\u0642\u0651\u062a\u064b\u0627 \u0644\u0644\u062d\u062f\u0651 \u0645\u0646 \u0627\u0644\u0648\u0642\u062a \u0627\u0644\u0630\u064a \u064a\u0645\u0643\u0646 \u0644\u0644\u0645\u062a\u0639\u0644\u0651\u0645\u064a\u0646 \u0642\u0636\u0627\u0624\u0647 \u0641\u064a \u062d\u0644 \u0645\u0633\u0627\u0626\u0644 \u0647\u0630\u0627 \u0627\u0644\u0642\u0633\u0645 \u0627\u0644\u0641\u0631\u0639\u064a. \u064a\u062c\u0628 \u0623\u0646 \u064a\u0642\u062f\u0651\u0645 \u0627\u0644\u0645\u062a\u0639\u0644\u0651\u0645\u0648\u0646 \u0627\u0644\u0625\u062c\u0627\u0628\u0627\u062a \u0642\u0628\u0644 \u0627\u0646\u062a\u0647\u0627\u0621 \u0627\u0644\u0648\u0642\u062a \u0627\u0644\u0645\u062d\u062f\u0651\u062f. \u0643\u0645\u0627 \u0648\u064a\u0645\u0643\u0646\u0643 \u0627\u0644\u0633\u0645\u0627\u062d \u0644\u0623\u062d\u062f \u0627\u0644\u0645\u062a\u0639\u0644\u0651\u0645\u064a\u0646 \u0628\u0648\u0642\u062a \u0625\u0636\u0627\u0641\u064a \u0628\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0644\u0648\u062d\u0629 \u0645\u0639\u0644\u0648\u0645\u0627\u062a \u0627\u0644\u0623\u0633\u062a\u0627\u0630.", 
    "Use as a Prerequisite": "\u0627\u0633\u062a\u062e\u062f\u0645\u0647 \u0643\u0645\u062a\u0637\u0644\u0651\u0628 \u0623\u0633\u0627\u0633\u064a", 
    "Use bookmarks to help you easily return to courseware pages. To bookmark a page, click \"Bookmark this page\" under the page title.": "\u0627\u0633\u062a\u062e\u062f\u0645 \u0627\u0644\u0639\u0644\u0627\u0645\u0627\u062a \u0627\u0644\u0645\u0631\u062c\u0639\u064a\u0651\u0629 \u0644\u062a\u062a\u0645\u0643\u0651\u0646 \u0645\u0646 \u0627\u0644\u0639\u0648\u062f\u0629 \u0625\u0644\u0649 \u0635\u0641\u062d\u0627\u062a \u0645\u062d\u062a\u0648\u064a\u0627\u062a \u0627\u0644\u0645\u0633\u0627\u0642 \u0628\u0633\u0647\u0648\u0644\u0629. \u0644\u0648\u0636\u0639 \u0639\u0644\u0627\u0645\u0629 \u0645\u0631\u062c\u0639\u064a\u0651\u0629 \u0644\u0635\u0641\u062d\u0629 \u0645\u0639\u064a\u0651\u0646\u0629\u060c \u0627\u062e\u062a\u0631 \"\u0639\u0644\u0627\u0645\u0629 \u0645\u0631\u062c\u0639\u064a\u0651\u0629\" \u062a\u062d\u062a \u0639\u0646\u0648\u0627\u0646 \u0627\u0644\u0635\u0641\u062d\u0629.", 
    "Use cohorts as the basis for dividing discussions. All learners, regardless of cohort, see the same discussion topics, but within divided topics, only members of the same cohort see and respond to each others\u2019 posts. ": "\u0627\u0633\u062a\u062e\u062f\u0645 \u0627\u0644\u0623\u0641\u0648\u0627\u062c \u0643\u0623\u0633\u0627\u0633 \u0644\u062a\u0642\u0633\u064a\u0645 \u0627\u0644\u0645\u062d\u0627\u062f\u062b\u0627\u062a. \u064a\u062a\u0645\u0643\u0646 \u062c\u0645\u064a\u0639 \u0627\u0644\u062f\u0627\u0631\u0633\u064a\u0646 \u0645\u0646 \u0631\u0624\u064a\u0629 \u0646\u0641\u0633 \u0627\u0644\u0645\u0648\u0627\u0636\u064a\u0639 \u0627\u0644\u0645\u0646\u0627\u0642\u0634\u0629 \u0628\u063a\u0636 \u0627\u0644\u0646\u0638\u0631 \u0639\u0646 \u0627\u0644\u0641\u0648\u062c\u060c \u0648\u0644\u0643\u0646 \u0636\u0645\u0646 \u0627\u0644\u0645\u0648\u0627\u0636\u064a\u0639 \u0627\u0644\u0645\u0642\u0633\u0645\u0629. \u064a\u0633\u062a\u0637\u064a\u0639 \u0641\u0642\u0637 \u0627\u0644\u062f\u0627\u0631\u0633\u0648\u0646 \u0627\u0644\u0630\u064a\u0646 \u064a\u0646\u062a\u0645\u0648\u0646 \u0627\u0644\u0649 \u0646\u0641\u0633 \u0627\u0644\u0641\u0648\u062c \u0645\u0646 \u0627\u0644\u0631\u0624\u064a\u0629 \u0648\u0627\u0644\u0631\u062f \u0639\u0644\u0649 \u0645\u0634\u0627\u0631\u0643\u0627\u062a \u0628\u0639\u0636\u0647\u0645 \u0627\u0644\u0628\u0639\u0636.", 
    "Use enrollment tracks as the basis for dividing discussions. All learners, regardless of their enrollment track, see the same discussion topics, but within divided topics, only learners who are in the same enrollment track see and respond to each others\u2019 posts.": "\u0627\u0633\u062a\u062e\u062f\u0645 \u0645\u0633\u0627\u0631\u0627\u062a \u0627\u0644\u062a\u0633\u062c\u064a\u0644 \u0643\u0623\u0633\u0627\u0633 \u0644\u062a\u0642\u0633\u064a\u0645 \u0627\u0644\u0645\u062d\u0627\u062f\u062b\u0627\u062a. \u064a\u062a\u0645\u0643\u0646 \u062c\u0645\u064a\u0639 \u0627\u0644\u062f\u0627\u0631\u0633\u064a\u0646 \u0645\u0646 \u0631\u0624\u064a\u0629 \u0646\u0641\u0633 \u0627\u0644\u0645\u0648\u0627\u0636\u064a\u0639 \u0627\u0644\u0645\u0646\u0627\u0642\u0634\u0629 \u0628\u063a\u0636 \u0627\u0644\u0646\u0638\u0631 \u0639\u0646 \u0645\u0633\u0627\u0631 \u0627\u0644\u062a\u0633\u062c\u064a\u0644\u060c \u0648\u0644\u0643\u0646 \u0636\u0645\u0646 \u0627\u0644\u0645\u0648\u0627\u0636\u064a\u0639 \u0627\u0644\u0645\u0642\u0633\u0645\u0629.  \u0641\u0642\u0637 \u0627\u0644\u062f\u0627\u0631\u0633\u0648\u0646 \u0627\u0644\u0630\u064a\u0646 \u064a\u0646\u062a\u0645\u0648\u0646 \u0627\u0644\u0649 \u0646\u0641\u0633 \u0645\u0633\u0627\u0631 \u0627\u0644\u062a\u0633\u062c\u064a\u0644 \u0645\u0646 \u0627\u0644\u0631\u0624\u064a\u0629 \u0648\u0627\u0644\u0631\u062f \u0639\u0644\u0649 \u0645\u0634\u0627\u0631\u0643\u0627\u062a \u0628\u0639\u0636\u0647\u0645 \u0627\u0644\u0628\u0639\u0636.", 
